INSERT INTO `exam_question` (`id`, `paper_type`, `use_type`, `type`, `question`, `answer_content`, `create_time`) VALUES
	(41, 'A', 1, 0, '五年来，我们统筹推进"____"总体布局、协调推进"____"战略布局，"十二五”规划胜利完成，"十三五”规划顺利实施，党和国家事业全面开创新局面。', '{"A":"五位一体、四个全面","B":"四位一体、五个全面","C":"五个全面、四位一体","D":"四个全面、五位一体","answer":"A"}', '2019-04-12 20:29:12'),
	(42, 'A', 1, 0, '社会主义核心价值观的主要内容即倡导富强、民主、文明、和谐，倡导自由、平等、公正、法治，倡导（）', '{"A":"爱岗、敬业、诚信、友善","B":"爱国、敬业、诚信、友善","C":"爱国、敬业、诚实、守信","D":"爱岗、敬业、克己、友善","answer":"B"}', '2019-04-12 20:29:12'),
	(43, 'A', 1, 0, '习近平总书记强调新时代共青团改革发展的目标任务，指出共青团要坚定不移走中国特色社会主义群团发展道路，牢牢把握根本任务、政治责任、工作主线，保持和增强（）、（）、（），始终紧跟党走在时代前列、走在青年前列。①革命性  ②政治性  ③先进性  ④群众性', '{"A":"①②③","B":"②③④","C":"①③④","D":"①②④","answer":"B"}', '2019-04-12 20:29:12'),
	(44, 'A', 1, 0, '团十八大报告指出，共青团的根本任务是（）。', '{"A":"为中国特色社会主义事业培养建设者和接班人","B":"引导青年明大理、识大势、知大任、养大德","C":"培养担当民族复兴大任的时代新人","D":"源源不断为党输送新鲜血液、锻造政治骨干","answer":"A"}', '2019-04-12 20:29:12'),
	(45, 'A', 1, 0, '团十八大报告指出，共青团的首要政治任务和核心业务是（）。', '{"A":"坚持不懈用习近平新时代中国特色社会主义思想构筑青年一代的强大精神支柱","B":"在青少年中大力弘扬社会主义核心价值观","C":"不断深化青少年党史和国情政策教育","D":"积极为党培养新时代的青年马克思主义者","answer":"A"}', '2019-04-12 20:29:12'),
	(46, 'A', 1, 0, '团十八大报告指出，共青团的重要政治功能是（）。', '{"A":"向青少年广泛有效传播党的路线方针政策和国家发展成就","B":"在青少年中大力弘扬社会主义核心价值观","C":"坚持不懈用习近平新时代中国特色社会主义思想构筑青年一代的强大精神支柱","D":"积极为党培养新时代的青年马克思主义者","answer":"A"}', '2019-04-12 20:29:12'),
	(47, 'A', 1, 0, '面向未来，我们必须一切     ，拿出壮士断腕的决心把改革进行到底，拿出_____的勇气管团治团，始终成为忠诚于党、紧跟党走的团，思想先进、理想坚定的团，心系青年、根植青年的团，勇于担当、奋发进取的团，朝气蓬勃、纪律严明的团。', '{"A":"聚焦主职主业 自我革新","B":"聚焦主责主业 自我革命","C":"聚焦主责主业 自我革命","D":"聚焦主职主业 自我革命","answer":"B"}', '2019-04-12 20:29:12'),
	(48, 'A', 1, 0, '2018年9月10日，全国教育大会在北京召开。中共中央总书记、国家主席、中央军委主席习近平出席会议并发表重要讲话。习总书记指出，教育是民族振兴、社会进步的重要基石，是功在当代、利在千秋的德政工程，对（   ）具有决定性意义。①提高人民综合素质           ②促进人的全面发展 ③增强中华民族创新创造活力   ④实现中华民族伟大复兴', '{"A":"①②③","B":"②③④","C":"①③④","D":"①②③④","answer":"D"}', '2019-04-12 20:29:12'),
	(49, 'A', 1, 0, '此次中学共青团改革，要用（ ）年的时间，使发展团员和团员管理实现有序规范, 团学比例逐步下降。', '{"A":"1  ","B":"2-3","C":"4-5 ","D":"5","answer":"B"}', '2019-04-12 20:29:12'),
	(50, 'A', 1, 0, '各中学的教师团干部每年至少直接联系（）个以上基层团支部, 具体指导团支部建设。', '{"A":"1","B":"2","C":"3","D":"5","answer":"A"}', '2019-04-12 20:29:12'),
	(51, 'A', 1, 0, '中学共青团改革，突出制定团员发展规划，强化县域统筹，用3年左右时间将初中、高中阶段毕业班团学比例分别控制在( )以内。', '{"A":"20%，50%","B":"50%，20%","C":"30%，60%","D":"60%，30%","answer":"C"}', '2019-04-12 20:29:12'),
	(52, 'A', 1, 0, '下列不属于团员大会上接收新团员的环节的是（）。', '{"A":"表决","B":"审批","C":"宣誓","D":"考察","answer":"D"}', '2019-04-12 20:29:12'),
	(53, 'A', 1, 0, '中学共青团改革实施方案》提出，每年要组织团员参加集中培训时间一般累计不少于1 天或者(  )学时。', '{"A":"8","B":"10","C":"12","D":"16","answer":"A"}', '2019-04-12 20:29:12'),
	(54, 'A', 1, 0, '开展中学生志愿服务应该从制度化、日常化、便利化、（ ）开展。', '{"A":"服务化","B":"系统化","C":"正向激励化","D":"健全化","answer":"C"}', '2019-04-12 20:29:12'),
	(55, 'A', 1, 0, '本次《中学生改革实施方案》把团建纳入学校党建工作规划和年度考核内容，团建工作占比不低于（ ）。', '{"A":"10%","B":"15% ","C":"18%","D":"20%","answer":"A"}', '2019-04-12 20:29:12'),
	(56, 'A', 1, 0, '本次《中学生改革实施方案》推行班级团支部与班委会一体化运行机制，探索实行班长兼任（ ）的制度。', '{"A":"团支部书记","B":"团支部副书记 ","C":"组织委员","D":"宣传委员","answer":"B"}', '2019-04-12 20:29:12'),
	(57, 'A', 1, 0, '共青团引领服务青年学生的“第一粒扣子”是（ ）。', '{"A":"少先队","B":"中学共青团 ","C":"高校共青团","D":"共青团中央","answer":"B"}', '2019-04-12 20:29:12'),
	(58, 'A', 1, 0, '中国共产主义青年团加强思想政治工作，把    贯穿所开展的全部工作。', '{"A":"青年思想工作","B":"思想政治工作","C":"青年工作","D":"思想引领工作","answer":"B"}', '2019-04-12 20:29:12'),
	(59, 'A', 1, 0, '中国共产主义青年团贯彻     原则，充分发挥党联系青年的桥梁和纽带作用，为党做好青年群众工作。', '{"A":"党管青年","B":"紧跟党走","C":"爱党爱国","D":"根植青年","answer":"A"}', '2019-04-12 20:29:12'),
	(60, 'A', 1, 0, '发展团员，必须把   放在首位。', '{"A":"政治标准","B":"专业素养","C":"爱党爱国","D":"学习能力","answer":"A"}', '2019-04-12 20:29:12'),
	(61, 'A', 1, 0, '新团员必须参加     ，在团旗下进行入团宣誓。', '{"A":"入团仪式","B":"团课学习","C":"入团考试","D":"入团竞选","answer":"A"}', '2019-04-12 20:29:12'),
	(62, 'A', 1, 0, '入团宣誓誓词如下：我志愿加人中国共产主义青年团，坚决拥护中国共产党的领导，    ，勤奋学习，积极工作，吃苦在前，享受在后，为共产主义事业而奋斗。', '{"A":"严守团的章程，执行团的决议，担负团员责任，恪守团的纪律","B":"遵守团的章程，执行团的决议，履行团员义务，严守团的纪律","C":"恪守团的章程，履行团的决议，完成团员义务，遵守团的纪律","D":"","answer":"B"}', '2019-04-12 20:29:12'),
	(63, 'A', 1, 0, '在团支部的基本工作制度“三会两制一课”中，“三会”指的是    。', '{"A":"团员代表会议．支部委员会．团小组会","B":"团员大会．团员代表会议．团小组会","C":"团员大会．支部委员会．团小组会","D":"团员大会．支部委员会．团员代表会议","answer":"C"}', '2019-04-12 20:29:12'),
	(64, 'A', 1, 0, '团的各级领导干部政治上要   ，学习要   ，工作要   ，作风要   ，品德要   。', '{"A":"坚定 刻苦 奋斗 严实 纯洁","B":"坚定 广泛 奋斗 严谨 纯洁","C":"坚强 刻苦 勤奋 严实 高尚","D":"坚强 广泛 勤奋 严谨 高尚","answer":"C"}', '2019-04-12 20:29:12'),
	(65, 'A', 1, 0, '为抓好团支部规范化建设，以"6+N"工程为主要工作抓手，加强基层团支部组织生活标准化、制度化建设。"6"是指每个团支部每年至少要组织1次    、1次     、4次    。①组织生活会    ②团日活动      ③团员教育评议   \n④支部大会      ⑤志愿服务      ⑥团课学习\n', '{"A":"①③⑥ ","B":"团课学习","C":"②③④","D":"","answer":"A"}', '2019-04-12 20:29:12'),
	(66, 'A', 1, 0, '   年5月4日，北京爆发五四爱国运动。', '{"A":"1918","B":"1919","C":"1921","D":"1922","answer":"B"}', '2019-04-12 20:29:12'),
	(67, 'A', 1, 0, '在中国共产党的关怀和领导下，中国社会主义青年团于1922年5月5日至10日在（  ）召开了第一次全国代表大会。这次大会的召开标志着中国社会主义青年团的正式建立。', '{"A":"上海","B":"广州","C":"北京","D":"","answer":"B"}', '2019-04-12 20:29:12'),
	(68, 'A', 1, 0, '1931年"九一八事变"后，日本帝国主义开始大举入侵。在民族危亡的重要关头，共青团响应党倡导建立抗日民族统一战线的召唤，于1935年12月发出     ，声明愿意开放组织，欢迎一切赞成抗日救国的青年加入。', '{"A":"《告全国青年书》","B":"《八一宣言》","C":"《为抗日救国告全国各校学生和.,各界青年同胞宣言》","D":"","answer":"C"}', '2019-04-12 20:29:12'),
	(69, 'A', 1, 0, '中国青年志愿者服务日是（ ）。', '{"A":"5月4日","B":"3月5日","C":"5月1日","D":"","answer":"B"}', '2019-04-12 20:29:12'),
	(70, 'A', 1, 0, '2014年5月4日，习近平总书记在北京大学师生座谈会上发表重要讲话，指出要自觉践行社会主义核心价值观，要    ，下得苦功夫，求得真学问；要    ，加强道德修养，注重道德实践；要    ，善于明辨是非，善于决断选择；要    ，扎扎实实干事，踏踏实实做人。', '{"A":"善学 修德 明辨 笃实","B":"勤学 修德 明辨 笃实","C":"勤学 修德 明辨 务实","D":"善学 修德 明辨 务实","answer":"B"}', '2019-04-12 20:29:12'),
	(71, 'A', 1, 0, '团的干部，必须锤炼优良作风。加强团干部作风建设，一要讲"严"字，二要讲"   "字。', '{"A":"政","B":"强","C":"实","D":"忠","answer":"C"}', '2019-04-12 20:29:12'),
	(72, 'A', 1, 0, '2018 年 7 月 2 日习近平总书记在同团中央新一届领导班子成员集体谈话中强调：要加强对青年       ，       就是团旗所向。', '{"A":"政治引领 党旗所指","B":"政治引导 党旗所指","C":"政治引领 党的要求","D":"政治引导 党的要求","answer":"A"}', '2019-04-12 20:29:12'),
	(73, 'A', 1, 0, '习近平总书记指出，青年一代（   ），国家就有前途、民族就有希望。', '{"A":"有梦想、有奋斗、有作为","B":"有理想、有本领、有作为","C":"有奋斗、有作为、有担当","D":"有理想、有本领、有担当","answer":"D"}', '2019-04-12 20:29:12'),
	(74, 'A', 1, 1, '一个国家、一个民族发展中更基本、更深沉、更持久的力量是制度自信。', '{"analysis":"文化自信","answer":"0"}', '2019-04-12 20:29:12'),
	(75, 'A', 1, 1, '担起强国使命，青年必须有理想，在能力上强。', '{"analysis":"思想","answer":"0"}', '2019-04-12 20:29:12'),
	(76, 'A', 1, 1, '共青团员是青年中的先进分子，团员先进性是团组织先进性的基石。', '{"analysis":"","answer":"1"}', '2019-04-12 20:29:12'),
	(77, 'A', 1, 1, '共青团改革构建“凝聚青年、服务大局、基层创新、从严治团”的工作格局，更好地团结带领青年发挥生力军和突击队作用。', '{"analysis":"当好桥梁","answer":"0"}', '2019-04-12 20:29:12'),
	(78, 'A', 1, 1, '被批准入团的青年从支部大会通过之日起开始算。', '{"analysis":"","answer":"1"}', '2019-04-12 20:29:12'),
	(79, 'A', 1, 1, '团的一切工作出发点和落脚点是争先创优。', '{"analysis":"","answer":"0"}', '2019-04-12 20:29:12'),
	(80, 'A', 1, 1, '.在团支部的基本工作制度"三会两制一课"中，"两制"指的是团员年度团籍注册制度和团费收缴制度。', '{"analysis":"","answer":"0"}', '2019-04-12 20:29:12'),
	(81, 'B', 1, 0, '.从全面建成小康社会到基本实现现代化，再到全面建成（ ），是新时代中国特色社会主义发展的战略安排。', '{"A":"社会主义现代化强国","B":"创新型国家","C":"社会主义现代化大国","D":"世界一流强国","answer":"A"}', '2019-04-12 20:29:12'),
	(82, 'B', 1, 0, '社会主义核心价值观的主要内容即倡导富强、民主、文明、和谐，倡导自由、平等、公正、法治，倡导（ ）。', '{"A":"爱岗、敬业、诚信、友善","B":"爱国、敬业、诚信、友善","C":"爱国、敬业、诚实、守信","D":"爱岗、敬业、克己、友善","answer":"B"}', '2019-04-12 20:29:12'),
	(83, 'B', 1, 0, '共青团改革取得的成果还只是初步的、阶段性的，不少举措还没有落到基层，改革中遇到的许多新问题仍有待破解，工作理念、工作方式、工作作风等方面的路径依赖依然比较普遍，"（  ）"问题的思想根子还有待进一步清除。①机关化  ②行政化  ③贵族化  ④娱乐化', '{"A":"②③","B":"②④","C":"①③④","D":"①②③④","answer":"D"}', '2019-04-12 20:29:12'),
	(84, 'B', 1, 0, '广大青年要从真理之光中受到启迪，用习近平新时代中国特色社会主义思想构筑强大精神支柱，（ ）。①听党话   ②跟党走   ③争先进   ④ 学优秀', '{"A":"②③","B":"③④","C":"①②","D":".①④","answer":"C"}', '2019-04-12 20:29:12'),
	(85, 'B', 1, 0, '团十八大报告指出，共青团的根本任务是（ ）。', '{"A":"为中国特色社会主义事业培养建设者和接班人","B":"引导青年明大理、识大势、知大任、养大德","C":"培养担当民族复兴大任的时代新人","C":".源源不断为党输送新鲜血液、锻造政治骨干","answer":"C"}', '2019-04-12 20:29:12'),
	(86, 'B', 1, 0, '团十八大报告指出，以习近平新时代中国特色社会主义思想为统领，必须坚持（ ）。①政治建团  ②思想立团  ③固本兴团 \n    ④改革强团  ⑤从严治团\n', '{"A":"①②③④","B":"①②③⑤","C":"①②③④⑤","D":".②③④⑤","answer":"C"}', '2019-04-12 20:29:12'),
	(87, 'B', 1, 0, '中国特色社会主义进入新时代，共青团紧扣时代主题，锐意改革创新，坚持从严治团，团结带领广大青年在党的领导下奋力投身伟大斗争、伟大工程、伟大事业、_____的生动实践。', '{"A":"伟大实践","B":"伟大胜利","C":"伟大成就","D":".伟大梦想","answer":"D"}', '2019-04-12 20:29:12'),
	(88, 'B', 1, 0, '以习近平新时代中国特色社会主义思想为统领，必须坚持_____。_____，是党的要求，更是共青团加强自身建设的迫切需要。要切实转观念、转方式、转作风，进一步破解制约共青团发展的思维定势、重点难点和体制机制问题，不断增强政治性、先进性、群众性，把共青团建设得更加坚强有力。', '{"A":"固本兴团 深化共青团改革","B":"固本兴团 推进共青团建设","C":"改革强团 深化共青团改革","D":".改革强团 推进共青团建设","answer":"C"}', '2019-04-12 20:29:12'),
	(89, 'B', 1, 0, '2018年9月10日，全国教育大会在北京召开。中共中央总书记、国家主席、中央军委主席习近平出席会议并发表重要讲话。习总书记强调，党的十八大以来，我们围绕培养什么人、怎样培养人、为谁培养人这一根本问题，坚持（   ），加强学校思想政治工作，推进教育改革，教育现代化加速推进。', '{"A":"德育为本","B":"立德树人","C":"以人为本","D":".学生为本","answer":"B"}', '2019-04-12 20:29:12'),
