	(140, 'C', 1, 0, '入团宣誓誓词如下：我志愿加人中国共产主义青年团，坚决拥护中国共产党的领导，    ，勤奋学习，积极工作，吃苦在前，享受在后，为共产主义事业而奋斗。', '{"A":"严守团的章程，执行团的决议，担负团员责任，恪守团的纪律","B":"遵守团的章程，执行团的决议，履行团员义务，严守团的纪律","C":"恪守团的章程，履行团的决议，完成团员义务，遵守团的纪律","D":"","answer":"B"}', '2019-04-12 20:29:12'),
	(141, 'C', 1, 0, '《团章》指出，中国共产主义青年团的      是中国共产主义青年团的象征和标志。', '{"A":"团旗、团徽、团歌","B":"团旗、团徽、团员证","C":"团徽、团员证、团歌","D":"团旗、团章、团歌","answer":"A"}', '2019-04-12 20:29:12'),
	(142, 'C', 1, 0, '以下不属于入团介绍人的任务是    。', '{"A":"向团组织说明被介绍人的经历、对团的认识、入团动机、思想品质和现实表现。","B":"向被介绍人解释团的章程，说明团员的条件、义务和权利。","C":"指导被介绍人填写《入团志愿书》、并填写自己的意见。向支部大会介绍被介绍人的情况。","D":"听取和团内外群众的意见，对被介绍人进行考察，并协助已具备条件的被介绍人办理入团手续。","answer":"D"}', '2019-04-12 20:29:12'),
	(143, 'C', 1, 0, '团代表大会的代表必须由下一级团代表大会、团员大会或______以无记名投票方式和差额选举办法选举产生。', '{"A":"上级团代表大会","B":"团支部","C":"团员代表会议","D":"同级团委常委","answer":"C"}', '2019-04-12 20:29:12'),
