	(163, 'D', 1, 0, '2018年9月10日，全国教育大会在北京召开。中共中央总书记、国家主席、中央军委主席习近平出席会议并发表重要讲话。习总书记指出，（  ）是教育的首要问题。', '{"A":"怎样培养人","B":"为谁培养人","C":"培养社会主义建设者和接班人","D":"培养什么人","answer":"D"}', '2019-04-12 20:29:12'),
