	(187, 'D', 1, 0, '在中国共产党的关怀和领导下，中国社会主义青年团于1922年5月5日至10日在（  ）召开了第一次全国代表大会。这次大会的召开标志着中国社会主义青年团的正式建立。', '{"A":"上海","B":"广州","C":"北京","D":"","answer":"B"}', '2019-04-12 20:29:12'),
	(188, 'D', 1, 0, '1939年5月4日，毛泽东同志在延安青年群众举行的五四运动20周年纪念会上发表著名演讲     。', '{"A":"《五四运动》","B":"《青年运动的方向》","C":"《青年团的工作要照顾青年的特点》","D":"","answer":"B"}', '2019-04-12 20:29:12'),
