	(190, 'D', 1, 0, '习近平总书记指出，青年一代（   ），国家就有前途、民族就有希望。', '{"A":"有梦想、有奋斗、有作为","B":"有理想、有本领、有作为","C":"有奋斗、有作为、有担当","D":"有理想、有本领、有担当","answer":"D"}', '2019-04-12 20:29:12'),
	(191, 'D', 1, 0, '习近平总书记在北京大学师生座谈会上对广大青年提出希望，要爱国、励志、求真、________。', '{"A":"创新","B":"力行","C":"笃行","D":"务实","answer":"B"}', '2019-04-12 20:29:12'),
	(192, 'D', 1, 1, '牢固树立政治意识、大局意识、集体意识、看齐意识，坚定维护以习近平同志为核心的党中央权威和集中统一领导，保证党的决定得到迅速有效的贯彻和执行。', '{"analysis":"核心意识","answer":"0"}', '2019-04-12 20:29:12'),
	(193, 'D', 1, 1, '群众性是共青团第一位的属性，必须把群众路线作为最高原则。', '{"analysis":"政治性、政治建团","answer":"0"}', '2019-04-12 20:29:12'),
	(194, 'D', 1, 1, '中国特色社会主义群团发展道路"六个坚持"指的是坚持人民主体地位、坚持科学发展、坚持深化改革、坚持依法治国、坚持践行社会主义核心价值观、坚持党的领导等。', '{"analysis":"坚持统筹国内国际两个大局","answer":"0"}', '2019-04-12 20:29:12'),
	(195, 'D', 1, 1, '团员要把综合能力摆在首位，平常时候看得出来、关键时刻冲得上去，做青年表率，不辜负共青团员的光荣称号。', '{"analysis":"政治先进","answer":"0"}', '2019-04-12 20:29:12'),
