	(198, 'D', 1, 1, '所谓团的组织生活是指有主题要求和教育意义，由团员参加，定期进行的一种团内生活。组织生活一般每月不少于一次。', '{"analysis":"","answer":"1"}', '2019-04-12 20:29:12'),
