	(200, 'D', 1, 1, '学习贯彻中央党的群团工作会议精神,最根本的就是要按照习近平总书记重要讲话的要求,切实保持和增强共青团的政治性、先进性、群众性。', '{"analysis":"","answer":"1"}', '2019-04-12 20:29:12'),
	(201, 'E', 1, 0, '从全面建成小康社会到基本实现现代化，再到全面建成（ ），是新时代中国特色社会主义发展的战略安排。', '{"A":"社会主义现代化强国","B":"创新型国家","C":"社会主义现代化大国","D":"世界一流强国","answer":"A"}', '2019-04-12 20:29:12'),
	(202, 'E', 1, 0, '社会主义核心价值观的主要内容即倡导富强、民主、文明、和谐，倡导自由、平等、公正、法治，倡导（ ）。', '{"A":"爱岗、敬业、诚信、友善","B":"爱国、敬业、诚信、友善","C":"爱国、敬业、诚实、守信","D":"爱岗、敬业、克己、友善","answer":"B"}', '2019-04-12 20:29:12'),
	(203, 'E', 1, 0, '习近平总书记强调新时代共青团改革发展的目标任务，指出共青团要坚定不移走中国特色社会主义群团发展道路，牢牢把握根本任务、政治责任、工作主线，保持和增强（）、（）、（），始终紧跟党走在时代前列、走在青年前列。①革命性  ②政治性  ③先进性  ④群众性', '{"A":"①②③","B":"②③④","C":"①③④","D":"①②④","answer":"B"}', '2019-04-12 20:29:12'),
	(204, 'E', 1, 0, '习近平出席全国教育大会并发表讲话中强调，要在（   ）上下功夫，教育引导学生树立共产主义远大理想和中国特色社会主义共同理想，增强学生的中国特色社会主义道路自信、理论自信、制度自信、文化自信，立志肩负起民族复兴的时代重任。', '{"A":"加强品德修养","B":"增长知识见识","C":"坚定理想信念","D":"培养奋斗精神","answer":"C"}', '2019-04-12 20:29:12'),
