	(243, 'A', 2, 0, '习近平总书记强调新时代共青团改革发展的目标任务，指出共青团要坚定不移走中国特色社会主义群团发展道路，牢牢把握根本任务、政治责任、工作主线，保持和增强（）、（）、（），始终紧跟党走在时代前列、走在青年前列。①革命性  ②政治性  ③先进性  ④群众性', '{"A":"①②③","B":"②③④","C":"①③④","D":"①②④","answer":"B"}', '2019-04-12 20:29:13'),
	(244, 'A', 2, 0, '共青团改革取得的成果还只是初步的、阶段性的，不少举措还没有落到基层，改革中遇到的许多新问题仍有待破解，工作理念、工作方式、工作作风等方面的路径依赖依然比较普遍，"（  ）"问题的思想根子还有待进一步清除。①机关化  ②行政化  ③贵族化  ④娱乐化', '{"A":"②③","B":"②④","C":"①③④","D":"①②③④","answer":"D"}', '2019-04-12 20:29:13'),
