	(248, 'A', 2, 0, '《少先队改革方案》 （B）年2月22日印发。少先队是中国共产党创立和领导的中国少年儿童的群众组织。为深入贯彻落实习近平总书记系列重要讲话精神，深入贯彻落实中央关于加强和改进党的群团工作的决策部署，深入贯彻落实党的十八大以来中央对共青团、少先队的要求，落实《共青团中央改革方案》要求，充分发挥少先队在立德树人中的作用，制定少先队改革方案。', '{"A":"2016","B":"2017","C":"2018年","D":"2019","answer":"B"}', '2019-04-12 20:29:13'),
