	(265, 'A', 2, 0, '2018年9月10日，全国教育大会在北京召开。中共中央总书记、国家主席、中央军委主席习近平出席会议并发表重要讲话。习总书记强调，党的十八大以来，我们围绕培养什么人、怎样培养人、为谁培养人这一根本问题，坚持（   ），加强学校思想政治工作，推进教育改革，教育现代化加速推进。', '{"A":"德育为本 ","B":"立德树人","C":"以人为本","D":"学生为本","answer":"B"}', '2019-04-12 20:29:13'),
