	(365, 'D', 2, 2, '队室布置应具备以下要素：（ ）。', '{"A":"少先队组织教育的展陈。包括领袖寄语，队徽，呼号，队歌，作风，誓词、队室挂图的布置，队旗、鼓号等礼仪用品的摆放。","B":"队委会办公室基本设备的安排。包括桌椅，报刊架，资料橱，档案柜等。还应有本届大队委员会委员及大队辅导员照片。大队委员会会议记录，大队荣誉测。各项工作档案等。","C":"少先队工作成果的陈列。本校队组织获得的奖杯、证书、具有重要意义的图片、题词，本校特色活动的作品等。","answer":"A,B"}', '2019-04-12 20:29:13'),
