	(384, 'E', 2, 0, '《少先队改革方案》 （ ）年2月22日印发。少先队是中国共产党创立和领导的中国少年儿童的群众组织。为深入贯彻落实习近平总书记系列重要讲话精神，深入贯彻落实中央关于加强和改进党的群团工作的决策部署，深入贯彻落实党的十八大以来中央对共青团、少先队的要求，落实《共青团中央改革方案》要求，充分发挥少先队在立德树人中的作用，制定少先队改革方案。', '{"A":"2016","B":"2017","C":"2018","D":"2019","answer":"B"}', '2019-04-12 20:29:13'),
	(385, 'E', 2, 0, '小学高年级佩戴（   ）号红领巾', '{"A":"小号","B":"大号","C":"都可","D":"","answer":"B"}', '2019-04-12 20:29:13'),
	(386, 'E', 2, 0, '队旗是少先队组织的标志。 五角星加火炬的红旗是少先队队旗, 五角星代表（ ）, 火炬象征光明, 红旗象征革命胜利。', '{"A":"中国共产党的领导","B":"光明","C":"从前进的方向","D":"","answer":"A"}', '2019-04-12 20:29:13'),
