	(388, 'E', 2, 0, '1946年到1949年建立的；1949年新中国成立后建立了全国统一的组织--中国少年儿童队，后改名为。', '{"A":"少年先锋队","B":"中国少年先锋队","C":"中国少年儿童队","D":"","answer":"C"}', '2019-04-12 20:29:13'),
	(389, 'E', 2, 0, '1979年，少先队开展了(   )活动。少先队员们在小发明、小制作过程中，登上了科学的阶梯，敲响了知识的大门，为自己成为祖国社会主义四化建设中的有用人才，迈出了可喜的一步。 ', '{"A":"我们爱祖国","B":"我们爱劳动","C":"我们爱科学","D":"我们爱集体","answer":"C"}', '2019-04-12 20:29:13'),
