	(397, 'E', 2, 0, '中国的未来属于青年，中华民族的未来也属于青年。青年一代的理想信念、精神状态、综合素质，是一个国家_______的重要体现，也是一个国家核心竞争力的重要因素。', '{"A":"发展动力","B":"发展活力","C":"综合竞争力","D":"发展潜力","answer":"A"}', '2019-04-12 20:29:13'),
	(398, 'E', 2, 0, '2018年9月10日，全国教育大会在北京召开。中共中央总书记、国家主席、中央军委主席习近平出席会议并发表重要讲话。习总书记指出，教育是民族振兴、社会进步的重要基石，是功在当代、利在千秋的德政工程，对（  ） 具有决定性意义。', ' {"A":"①②③","B":"②③④","C":"①③④","D":"①②③④","answer":"D"}', '2019-04-12 20:29:13'),
	(399, 'E', 2, 0, '社会主义核心价值观的主要内容即倡导富强、民主、文明、和谐，倡导自由、平等、公正、法治，倡导（  ）。', '{"A":"爱岗、敬业、诚信、友善","B":"爱国、敬业、诚信、友善","C":"爱国、敬业、诚实、守信","D":"爱岗、敬业、克己、友善","answer":"B"}', '2019-04-12 20:29:13'),
	(400, 'E', 2, 2, '各地小学和初中要保障少先队工作基本条件。', '{"A":"普遍开展中小学少先队活动课，确保充足的少先队活动时间","B":"大力支持少先队创造性开展校内外实践活动，支持建设好少先队集体","C":"保证学校少先队队室、鼓号队、红领巾广播站（电视台、网站，有条件的地方）、宣传栏、中队阵地等基本阵地和配备","D":"积极创造校内外少先队实践活动阵地","answer":"A,B,C,D"}', '2019-04-12 20:29:13'),
	(401, 'E', 2, 2, '少先队可开展的活动（    ) ，深化"雏鹰奖章"的系统过程激励，培养锻炼全体少先队员的社会责任感、创新精神和实践能力。', '{"A":"在校内外创新开展“小小志愿者”活动","B":"在中队集体里广泛开展“红领巾小健将”等足球和体育游戏活动","C":"“红领巾小百灵”歌咏活动","D":"“红领巾小书虫”读书活动","E":"“红领巾小创客”创新创意创造活动","F":"红领巾小主人”岗位服务活动等","answer":"A,B,C,D,E,F"}', '2019-04-12 20:29:13'),
	(402, 'E', 2, 2, '队前教育"四会"包括哪些内容（）。', '{"A":"会系红领巾","B":"会敬队礼","C":"会呼号","D":"会唱队歌","answer":"A,B,C,D"}', '2019-04-12 20:29:13'),
	(403, 'E', 2, 2, '红领巾规格分为小号、大号，分别是：（）', '{"A":"小号：底边长100厘米、腰边长60厘米","B":"大号：底边长120厘米、腰边长72厘米","answer":"A,B"}', '2019-04-12 20:29:13'),
	(404, 'E', 2, 2, '充分发挥队室的作用，有效的利用队室进行各种少先队教育活动（ ）', '{"A":"安排参观","B":"进行活动","C":"举办讲座","D":"组织阅读","answer":"A,B,C,D"}', '2019-04-12 20:29:13'),
	(405, 'E', 2, 2, '中队黑板报是各地学校普遍具备的中队宣传阵地。是培育中队集体良好舆论的重要手段之一。（   ）', '{"A":"队委会自主管理","B":"表现本中队特色","C":"符合队员年龄特点","D":"中队辅导员来做","answer":"A,B,C"}', '2019-04-12 20:29:13'),
	(406, 'E', 2, 1, '十九大报告指出，中国共产主义青年团是中国共产党领导的先进青年的群团组织，是广大青年在实践中学习中国特色社会主义和共产主义的学校，是党的助手和后备军。', '{"analysis":"","answer":"1"}', '2019-04-12 20:29:13'),
	(407, 'E', 2, 1, '一个国家、一个民族发展中更基本、更深沉、更持久的力量是制度自信。', '{"analysis":"文化自信","answer":"0"}', '2019-04-12 20:29:13'),
	(408, 'E', 2, 1, '共青团事业是党的事业的重要组成部分，事关党执政的青年群众基础，事关党和国家的未来。', '{"analysis":"","answer":"1"}', '2019-04-12 20:29:13'),
	(409, 'E', 2, 1, '共青团员是青年中的先进分子，团员先进性是团组织先进性的基石。', '{"analysis":"","answer":"1"}', '2019-04-12 20:29:13'),
	(410, 'E', 2, 1, '加强思想教育和管理培训，教育引导全体少先队工作干部和少先队辅导员增强"四个意识"，坚定"四个自信"，提高思想政治素质和专业能力水平。', '{"analysis":"","answer":"1"}', '2019-04-12 20:29:13'),
	(411, 'E', 2, 1, '不用从少年儿童的思想和生活实际出发，发挥少先队员小主人作用，生动活泼、创造性地开展工作。维护少年儿童合法权益。', '{"analysis":"","answer":"0"}', '2019-04-12 20:29:13'),
	(412, 'E', 2, 1, '发展新队员完成之后，进入建立队组织阶段。', '{"analysis":"","answer":"1"}', '2019-04-12 20:29:13'),
	(413, 'E', 2, 1, '少先队入队誓词：我是中国少年先锋队队员。 我在队旗下宣誓: 我热爱中国共产党, 热爱祖国, 热爱人民, 好好学习, 好好锻炼, 准备着: 为 共产主义事业贡献力量! ', '{"analysis":"","answer":"1"}', '2019-04-12 20:29:13'),
	(414, 'E', 2, 1, '少先队队室陈列队歌曲谱和歌词。', '{"analysis":"","answer":"1"}', '2019-04-12 20:29:13'),
	(415, 'E', 2, 1, '红领巾颜色采用国旗红, 可用布、 绸、 缎等材料按照标准 制作。', '{"analysis":"","answer":"1"}', '2019-04-12 20:29:13'),
	(416, 'D', 2, 0, '党的十九大是在全面建成小康社会决胜阶段、中国特色社会主义进入（  ）的关键时期召开的一次十分重要的大会。', '{"A":"新时期","B":"新时代","C":"新征程","D":"新阶段","answer":"B"}', '2019-04-12 20:29:13'),
	(417, 'D', 2, 0, '新时代中国特色社会主义思想，明确中国特色社会主义最本质的特征是（ ）。', '{"A":"“五位一体”总体布局   ","B":"建设中国特色社会主义法治体系\n ","C":"人民利益为根本出发    ","D":"中国共产党领导","answer":"D"}\n', '2019-04-12 20:29:13'),
	(418, 'D', 2, 0, '党中央在团十八大致词中强调，共青团要。（ ）①坚持不懈用习近平新时代中国特色社会主义思想武装全团、教育青年，掀起“青年大学习”的热潮\n  ②积极服务党和国家工作大局，找准工作切入点、结合点、着力点\n  ③扎实推动和服务青年发展，不断把党的温暖传递给青年\n  ④推动共青团改革向纵深发展、在基层落地，坚持从严治团', '{"A":"①②③   ","B":"①②④   ","C":"①②③④   ","D":"②③④","answer":"C"}', '2019-04-12 20:29:13'),
	(419, 'D', 2, 0, '团的十八大报告强调,担起强国使命,青年必须有( ),在思想精神上强;必须有( ),在能力素质上强;必须有( ),在干事创业上强。', '{"A":"理想 本领 担当   ","B":"理想 本领 责任\n   ","C":"志向 本领 担当   ","D":"志向 才能 担当","answer":"A"}\n\n', '2019-04-12 20:29:13'),
	(420, 'D', 2, 0, '基层团干部要有信念、善服务、有本领、(    )，共青团就有生命、战斗力。（  ）', '{"A":"有干劲    ","B":"有理想    ","C":"在状态    ","D":"有担当","answer":"C"}\n', '2019-04-12 20:29:13'),
	(421, 'D', 2, 0, '王沪宁在共青团十八大讲话上指出我国广大青年要牢记习近平总书记关于"（       ）"的教导，始终坚定理想信念。（ ）', '{"A":"革命理想高于天    ","B":"没有共产党就没有新中国\n  ","C":"知识就是力量      ","D":"“扣好人生第一粒扣子","answer":"A"}\n', '2019-04-12 20:29:13'),
	(422, 'D', 2, 0, '党的十九大是在全面建成小康社会决胜阶段、中国特色社会主义进入（）的关键时期召开的一次十分重要的大会。', '{"A":"精准   ","B":"一对一  ","C":"榜样  ","D":" 耐心","answer":"B"}', '2019-04-12 20:29:13'),
	(423, 'D', 2, 0, '以下不是《改革方案》基本原则（ ）', '{"A":"坚持党的领导","B":"牢记队的使命","C":"服务队员成长","D":"打牢基层基础","E":"不用继承只求创新","answer":"E"}', '2019-04-12 20:29:13'),
	(424, 'D', 2, 0, '坚持少先队作为中国特色社会主义事业战略预备队的基本定位和促进少年儿童全面发展的工作主线，紧紧围绕(   )的根本任务，推进少先队工作改革创新，', '{"A":"培养人才","B":"身心健康","C":"立德树人","D":"快乐成长","answer":"C"}', '2019-04-12 20:29:13'),
	(425, 'D', 2, 0, '少先队员敬队礼：立正, 右手五指并拢, 手掌与小臂成直线, 自下至上经胸前 高举头上约（   ） 厘米 ，动作自然流畅, 掌心朝向左前下方。', '{"A":"3  ","B":"4  ","C":"5  ","D":"6","answer":"C"}', '2019-04-12 20:29:13'),
	(426, 'D', 2, 0, '少先队辅导员在参加少先队集会、 活动时, 应佩戴（   ）号 红领巾。 少先队活动邀请有关领导、 来宾等成年人参加时, 领导、 来宾也佩戴（ ）号红领巾。', '{"A":" 超大号","B":"大号","C":" 中号","D":"小号","answer":"B"}', '2019-04-12 20:29:13'),
	(427, 'D', 2, 0, '1 名少先队员旗手和至少2 名少先队员护旗手组成旗手组合, 旗手右手握旗杆下部贴腰, 左手伸直握旗杆中上部, 队旗倾斜成约 (    )度角。', '{"A":"30   ","B":"35  ","C":"40   ","D":"45 ","answer":"D"}', '2019-04-12 20:29:13'),
	(428, 'D', 2, 0, '1937年到1945年（   ）', '{"A":"抗日儿童团；","B":"劳动童子军","C":"少年先锋队","D":"中国少年先锋队","answer":"A"}', '2019-04-12 20:29:13'),
	(429, 'D', 2, 0, '第二次国内革命战争时期，我们革命儿童的组织叫(   )', '{"A":"抗日儿童团；","B":"劳动童子军","C":"少年先锋队","D":"共产儿童团","answer":"D"}', '2019-04-12 20:29:13'),
	(430, 'D', 2, 0, '五角星加火炬和写有(   )的红色绶带组成我们的队徽。', '{"A":"少年先锋队","B":"中国少年先锋队 ","C":"中国少先队","D":"","answer":"C"}', '2019-04-12 20:29:13'),
	(431, 'D', 2, 0, '中队辅导员的和队员不应是（ ）的关系。', '{"A":"亲密朋友伙伴。","B":"帮助队委会","C":"管理与被管理","D":"少先队集体的指导者","answer":"C"}', '2019-04-12 20:29:13'),
	(432, 'D', 2, 0, '（ ）是少先队的最基层组织，是少先队确立组织归属感的最直接层级。', '{"A":"大队","B":"中队","C":"小队","D":"","answer":"C"}', '2019-04-12 20:29:13'),
	(433, 'D', 2, 0, '初中队员日常可佩戴队徽。集会等活动时（ ）', '{"A":"统一戴红领巾","B":"佩戴队徽","C":"佩戴团徽","D":"","answer":"A"}', '2019-04-12 20:29:13'),
	(434, 'D', 2, 0, '队室是学校少先队必备场所，是大队部的所在地，属于少先队组织教育类的阵地。（ ）', '{"A":"每一个少先队大队都必须设有队室。","B":"以两间教室为宜","C":"门前不用有少先队队室标志或标牌儿","D":"可以兼用。","answer":"A"}', '2019-04-12 20:29:13'),
	(435, 'D', 2, 0, '凡是6周岁到14周岁的少年儿童，愿意参加少先队，愿意遵守队章，向（ ）提出申请，经批准就成为少先队员。', '{"A":" 少先队组织   ","B":"县、市少先队组织   ","C":" 所在学校少先队组织   ","D":" 全国少工委","answer":"C"}', '2019-04-12 20:29:13'),
	(436, 'D', 2, 0, '当代青年生逢强国时代，肩负强国使命，要在党的领导下，奋勇投身党的十九大绘就的宏伟蓝图，奋力将建成       的目标在自己手中变成现实。（  ）', '{"A":"小康社会    ","B":"社会主义现代化强国\n","C":"世界强国    ","D":"富强、民主、文明、和谐的现代化国家","answer":"B"}\n', '2019-04-12 20:29:13'),
	(437, 'D', 2, 0, '2018年7月2日，习近平总书记在同团中央新一届领导班子成员集体谈话中强调：新时代的青年工作要毫不动摇坚持党的领导，坚定不移走      ，紧紧围绕、始终贯穿为实现中国梦而奋斗的主题，让广大青年      。', '{"A":"中国特色社会主义群团发展道路；敢于有梦、勇于追梦、勤于圆梦\n","B":"新时代中国特色社会主义群团发展道路；敢于有梦、善于追梦、勇于圆梦\n","C":"新时代中国特色社会主义群团发展道路；敢于有梦、勇于追梦、勤于圆梦\n","D":"中国特色社会主义群团发展道路；敢于有梦、善于追梦、勇于圆梦","answer":"A"}\n', '2019-04-12 20:29:13'),
	(438, 'D', 2, 0, '习近平总书记在北京大学师生座谈会上对广大青年提出希望，要爱国、励志、求真、________。（  ）', '{"A":"创新    ","B":"力行    ","C":"笃行    ","D":"务实","answer":"B"}', '2019-04-12 20:29:13'),
	(439, 'D', 2, 0, '习近平出席全国教育大会并发表讲话中强调，要在（ ）上下功夫，教育引导学生树立共产主义远大理想和中国特色社会主义共同理想，增强学生的中国特色社会主义道路自信、理论自信、制度自信、文化自信，立志肩负起民族复兴的时代重任。', '{"A":"加强品德修养 ","B":"增长知识见识\n ","C":"坚定理想信念 ","D":"培养奋斗精神","answer":"C"}\n', '2019-04-12 20:29:13'),
	(440, 'A', 2, 1, '队会流程中，队员演唱《中国少年先锋队队歌》一段即可。', '{"analysis":"","answer":"0"}', '2019-04-12 21:26:32');
